/*
 * This sets up the test case and runs initialization routines.
 * 
 */

// get a reference to the Common test case
// walking back up the test suite tree from the current test case
// to get the specific test case "Common".
testCase = testRunner.getTestCase().getTestSuite().getProject().getTestSuiteByName("TestBed").getTestCaseByName("Common")  

// run the InitializeVariables step of Common test case
initStep = testCase.testSteps["InitializeVariables"] 
initStep.run(testRunner, context)  

// run the EncodeInputFile step of Common test case.
initStep = testCase.testSteps["EncodeInputFile"] 
initStep.run(testRunner, context)

/* The Common test case is not called directly, but is referenced by 
 * LoB-specific test cases.
 */

// set the following properties to empty...
testRunner.testCase.setPropertyValue("InputFileBase64",'');
testRunner.testCase.setPropertyValue("JobStatus", '')
testRunner.testCase.setPropertyValue("JobID", '')

// create a GUID to use...
def guidVal = "${java.util.UUID.randomUUID()}"

// set the Correlation ID with the GUID
testRunner.testCase.setPropertyValue("CorrelationId", guidVal)

/*
 * Load/parse and encode extract data.
 * Input file is named in LOB-test case property "InputFile"
 * Input file is expected to be in subdirectory called "input" 
 * and is relative to soapUI project file, e.g.:
 * ./odee_1262_tester.xml
 * ./input/file.xml
 * 
 */
import javax.mail.util.ByteArrayDataSource;

def extractFile = testRunner.testCase.getPropertyValue("InputFile");

def xmlInput;
def xmlInputParsed;

if (extractFile != "" && extractFile != null)
{
	// get the absolute path of the extract data
	String extractFilePath = getAbsolutePath("/input/" + extractFile)
	// read the extract file into a string
	String xmlstring = new File(extractFilePath).text
	// base64-encode the string, and write to the test case property.
	testRunner.testCase.setPropertyValue("InputFileBase64",xmlstring.bytes.encodeBase64().toString());

}			

String getAbsolutePath(String relativePath) {
	def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context);
	def thePath = groovyUtils.projectPath + relativePath;
	return thePath;
 }

import com.eviware.soapui.support.XmlHolder
import org.apache.commons.codec.binary.Base64;
import java.text.SimpleDateFormat;

def alert = com.eviware.soapui.support.UISupport;

def responseHolder = new XmlHolder(context.response);

// parse the response to get the job status, set test case property.
def jobStatus = responseHolder["//ns8:JobStatus/text()"];
testRunner.testCase.setPropertyValue("JobStatus",jobStatus);

// parse response to get the job ID, set test case property.
def jobId = responseHolder["//ns8:Job_Id/text()"].toString()
jobId = jobId.substring(1,jobId.indexOf(','));
testRunner.testCase.setPropertyValue("JobID",jobId);

// count number of pubs and set property.
def pubCount = responseHolder["count(//ns4:Publication)"]
testRunner.testCase.setPropertyValue("PublicationsCount",pubCount);

// check the job Status and report on the result.
switch(jobStatus)
{
	case "290":
		alert.showInfoMessage("Transaction routed to Interactive");
		break;

	case "999":
		alert.showInfoMessage("Transaction completed successfully. JOBID=" + jobId)
		// maybe show a message here about location of output files.
		// or view in dashboard.				
		break;

	default:
		context.testRunner.fail('');
		alert.showErrorMessage("Transaction returned status code: " + jobStatus);
		break;
}

import com.eviware.soapui.support.XmlHolder
import org.apache.commons.codec.binary.Base64;
import java.text.SimpleDateFormat;

def alert = com.eviware.soapui.support.UISupport;

def responseHolder = new XmlHolder(context.response);

// parse the response to get the job status, set test case property.
def jobStatus = responseHolder["//ns8:JobStatus/text()"];
testRunner.testCase.setPropertyValue("JobStatus",jobStatus);

// parse response to get the job ID, set test case property.
def jobId = responseHolder["//ns8:Job_Id/text()"].toString()
jobId = jobId.substring(1,jobId.indexOf(','));
testRunner.testCase.setPropertyValue("JobID",jobId);

// get count of attachments.
def attachmentsCount = responseHolder["count(//ns8:Data)"]
testRunner.testCase.setPropertyValue("AttachmentsCount",attachmentsCount);


switch(jobStatus)
{
	case "290":
		alert.showInfoMessage("Transaction routed to Interactive");
		break;

	case "999":
		SaveFiles(attachmentsCount,responseHolder)
		alert.showInfoMessage("Transaction generated successfully. Output is located in [/" + testRunner.testCase.name + "] with timestamp.");
		break;

	default:
		context.testRunner.fail('');
		alert.showErrorMessage("Transaction response is " & jobStatus);
		break;
}

String getAbsolutePath(String relativePath) {

                def groovyUtils = new com.eviware.soapui.support.GroovyUtils(context);
                def dir = groovyUtils.projectPath + relativePath;			
                return dir;
}

String SaveFiles(attachmentsCount,responseHolder) {
	int counter = attachmentsCount.toInteger()

	for (i=1; i <= counter; i++) {

		def name = responseHolder["//ns8:Data[" + i +"]/ns4:Name/text()"]
		def ext = responseHolder["//ns8:Data[" + i +"]/ns4:FileType/text()"]

		def date = new Date()
		sdf = new SimpleDateFormat("yyyy-MM-dd hhmmss")
		String prefix = getAbsolutePath("/output/" + testRunner.testCase.name + "/" + sdf.format(date) + "/")
		//Create parent directories if does not exists
		testRunner.testCase.setPropertyValue("Output",prefix);
		log.info "Attachment: " + i + ", Filename: " + prefix + name + "." + ext
		String b64str = responseHolder["//ns8:Data[" + i + "]/ns4:Content/ns4:Binary/text()"]
		if (b64str.length() > 0){
			byte[] decoded = b64str.decodeBase64();
			def output = new File(prefix + name + "." + ext)
			//Create parent directories if does not exists
			if (!output.parentFile.exists()) {
    				output.parentFile.mkdirs()
			}
			output.bytes = decoded;
		}
	}
}

